@mixin hoverEffect($backgroundImage) {
    position: relative;

    &::before {
        content: "";
        position: absolute;
        width: 100%;
        height: 100%;
        background-image: url(#{$backgroundImage});
        background-size: cover;
        transition: transform 0.3s;
        z-index: -1;
    }

    &:hover::before {
        transform: scale(1.02);
    }

